var documentoService={add:function(e,t){try{connector.post(url.documento.add,e,function(e){null!=e?(successMessage({title:message.documento.add.title,content:message.documento.add.success}),t(e)):errorMessage({title:message.documento.add.title,content:message.documento.add.error})})}catch(e){console.log(e)}},update:function(e,t){try{connector.post(url.documento.update,e,function(e){null!=e&&1===e?(successMessage({title:message.documento.update.title,content:message.documento.update.success}),t(e)):errorMessage({title:message.documento.update.title,content:message.documento.update.error})})}catch(e){console.log(e)}},remove:function(e,t){try{connector.post(url.documento.delete,e,function(e){null!=e&&1===e?(successMessage({title:message.documento.delete.title,content:message.documento.delete.success}),t(e)):errorMessage({title:message.documento.delete.title,content:message.documento.delete.error})})}catch(e){console.log(e)}},list:function(t){try{connector.post(url.documento.list,null,function(e){null!=e&&0<e.length?t(e):infoMessage({title:message.documento.list.title,content:message.documento.list.empty})})}catch(e){console.log(e)}}};